export const dataview = {
    textStyle: {
        alignSelf: 'center',
        color: '#336633',
        fontSize: 16,
        fontWeight: '600',
        paddingTop: 10,
        paddingBottom: 10,
    },
    container: {
        display:"flex",
        flexDirection:"column",
        padding: 10,
        borderWidth: 1,
        borderColor: '#336633',
    },
    text:{
        fontSize:2,
        fontWeight:"bold",
        backgroundColor:"black"
    },
    input:{
        flexDirection: 'row',
        alignItems: 'center',
        backgroundColor: '#fff', // Customize as needed
        borderRadius: 8, // Customize as needed
        paddingHorizontal: 8,
        borderWidth: 1, // Customize as needed
        borderColor: '#ccc',
    }
};
